import React from 'react';
import './style.css'

const dataWeb = Date.now();

console.log('====================================');
console.log(dataWeb);
console.log('====================================');

const Footer = () => (

    <div id="main-footer">
        <footer className="footer-basic-centered">

            <p id="footer-company-motto">
                ENgAGED.
            </p>

            <p id="footer-links">
                <a href=" ">Home</a>
            </p>

            <p id="footer-company-name">Todos os direitos reservados &copy; `this.dataWeb`</p>

        </footer>
    </div>
);

export default Footer;
